INSERT INTO `products` (`id`, `name`, `description`, `category`, `prix`, `quantity`) VALUES
(1, 'HomeMaster CeMac', 'Voici le coeur de notre système de Domotique. Ce système, entièrement équipé de capteurs, collecte les données de température, de luminosité, d\'humidité de votre pièce. ', 'peripheral', 100, NULL),
(2, 'HomeMaster Thermomètre', 'Cet outil est à la pointe de la technologie en matière de mesure de température. Relié au CeMac, vous pourrez ainsi contrôler la température de la pièce que vous souhaitez.', 'peripheral', 19, NULL),
(3, 'HomeMaster Luxmètre', 'Vous souhaitez mettre en place une ambiance tamisée connectée dans votre maison ?\r\nA l\'aide de cet objet, c\'est possible !', 'peripheral', 25, NULL),
(4, 'HomeMaster Watcher\r\n', 'Vous partez en vacances ? Vous avez des objets de valeur chez vous et ne souhaitez pas qu\'on vous les dérobe ? \r\nAchetez et installez notre capteur de sécurité vérifiant que personne ne s\'introduise chez vous en votre absence. ', 'peripheral', 59, NULL),
(5, 'HomeMaster Pure Breath', 'Vous souhaitez connaître l\'état de l\'air de votre maison? Ce détecteur de particules fines et de Co2 vous prévient si cet état dépasse un seuil d\'alerte. ', 'peripheral', 19, NULL),
(6, 'HomeMaster Fire Guard', 'Rien de tel qu\'une alarme incendie connectée afin de vous prévenir si de la  fumée est détectée dans votre appartement. De nombreuses vies ont déjà été sauvées grâce à ce dispositif.', 'peripheral', 19, NULL),
(7, 'HomeMaster Loading Battery', 'Rechargez la batterie de votre capteur avec nos batteries facile à la manipulation. ', 'accessory', 9, NULL);
